 <v:textbox>
  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-color-alt:windowtext'>El ser humano asocia los colores a
    diferentes sensaciones y emociones. Es una sensación sobre la que realmente
    no tenemos control y muchas veces no nos damos cuenta de ello pues estamos
    acostumbrados a ver colores a donde vayamos.</span><span style='font-size:
    9.0pt;line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:
    minor-latin'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-color-alt:windowtext'>Estamos rodeados de colores. Estos
    forman parte de la vida misma, y el ser humano es uno de los seres
    privilegiados de la Naturaleza por poder disfrutar de ellos.</span><span
    style='font-size:9.0pt;line-height:105%;mso-bidi-font-family:Calibri;
    mso-bidi-theme-font:minor-latin'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-color-alt:windowtext'>Cuando vamos por la calle, cuando
    estamos trabajando o disfrutando de nuestro tiempo libre o cuando estamos
    navegando por Internet recibimos constantemente impresiones de color por
    medio de nuestra vista, y estas impresiones tienen la facultad de excitarnos,
    de tranquilizarnos, de ponernos de buen humor o de inspirarnos pena. Es el
    mundo de color.</span><span style='font-size:9.0pt;line-height:105%;
    mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin'><o:p></o:p></span></p>
    </div>
    <![if !mso]></td>
   </tr>
  </table>
  <![endif]></v:textbox>

    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-themecolor:text1'>Trabajar con color nunca es una tarea
    sencilla. Hay tanto factores que debemos tener en cuenta como el brillo, el
    contraste, la saturación, el tono, etc. Aparte de tener estos conceptos
    aprendidos sobre la teoría del color, tal vez sea necesario aprender también
    sobre la psicología del color para poder realizar una selección de colores
    más acertada en nuestros diseños.</span><span style='mso-bidi-font-family:
    Calibri;mso-bidi-theme-font:minor-latin'><o:p></o:p></span></p>
